import '@4tw/cypress-drag-drop';
import { getHandleSelector } from './util';
import * as keyCodes from './keyCodes';

describe("Drag and Drop Task", () => {
    beforeEach(() => {
        cy.visit("http://localhost:3000/", {
            onBeforeLoad(win) {
              win.localStorage.setItem(
                "kunal",
                JSON.stringify({
                  username: "kunal",
                  email: "kunalukey32@gmail.com",
                  password: "Kunal@321",
                })
              );
              win.localStorage.setItem("trackier-current-user", "kunal");
              win.localStorage.setItem("trackier-current-projects", JSON.stringify([{
                  id: 123,
                  username: "kunal",
                  project: "Test Project",
                  description: "Test Project Description Test Project Description Test Project Description Test Project Description Test Project Description",
                  image: "data:image/png;base64,"
              }]));
            },
          });
      });

      it("Drag Task 1", () => {
        cy.get('.MuiTypography-h5').click();
        cy.get(':nth-child(2) > .MuiButtonBase-root').click();
        cy.get('.css-dvxtzn > .MuiTypography-root').contains("Add Task");
        cy.get('#title').type("Test Task 1");
        cy.get('#description').type("Task Description Task Description Task Description Task Description Task Description.");
        cy.get('#assignedusers').type("Test Assigned User");
        cy.get('#date').type("13/07/2023");
        cy.get('.MuiBox-root > .MuiButtonBase-root').click();

        cy.get(':nth-child(2) > .MuiButtonBase-root').click();
        cy.get('.css-dvxtzn > .MuiTypography-root').contains("Add Task");
        cy.get('#title').type("Test Task 2");
        cy.get('#description').type("Task Description Task Description Task Description Task Description Task Description.");
        cy.get('#assignedusers').type("Test Assigned User");
        cy.get('#date').type("13/07/2023");
        cy.get('.MuiBox-root > .MuiButtonBase-root').click();

        cy.get(getHandleSelector()).eq(0).as('first');
        cy.get(getHandleSelector()).eq(1).as('second');

        cy.get('@first')
        .focus()
        .trigger('keydown', { keyCode: keyCodes.space })
        // need to re-query for a clone
        .get('@first')
        .trigger('keydown', { keyCode: keyCodes.arrowDown, force: true })
        // finishing before the movement time is fine - but this looks nice
        .wait(100)
        .trigger('keydown', { keyCode: keyCodes.space, force: true });
      })
      
})